import React, { useState } from "react";
import {Link} from 'react-router-dom';
import axios from 'axios';
export default function Register() {
    const [user,setuser]=useState("");
    const [pass,setpass]=useState("");
    const [email,setemail]=useState("");
    const [phone,setphone]=useState("");
    const [college,setcollege]=useState("");
    const formData = new FormData();
    formData.append('username', user);
    formData.append('password', pass);
    formData.append('email', email);
    formData.append('phone', phone);
    formData.append('college', college);

    const SaveVal=(event)=>
    {
        event.preventDefault();
        axios.post("http://localhost:9090/reg",formData).then(response => {
            const responseData = response.data;
            window.alert(responseData)
            if(responseData==="Success")
            window.location.replace('http://localhost:3000/login')
        });
    }
    return (
        <div>
        <h1>Hello User this is Register</h1>
        <form onSubmit={SaveVal}>
            Username : <input type="text" placeholder="Enter Username" value={user} name="user" required onChange={(e)=>{setuser(e.target.value)}}></input><br/>
            Password : <input type="password" placeholder="Enter Password" value={pass} name="pass" required onChange={(e)=>{setpass(e.target.value)}}></input><br/>
            Email : <input type="text" placeholder="Enter Email" value={email} name="email" required onChange={(e)=>{setemail(e.target.value)}}></input><br/>
            PhoneNo : <input type="text" placeholder="Enter PhoneNo" value={phone} name="phone" required onChange={(e)=>{setphone(e.target.value)}}></input><br/>
            <input type="text" placeholder="Enter CollegeName" value={college} name="college" required onChange={(e)=>{setcollege(e.target.value)}}></input><br/>
            <button type="submit">Register</button>
        </form>
        <Link to="/login">Login</Link>
        </div>
    );
}
